import React, { useState, useEffect } from "react";
import Layout from "./Layout";
import { getProducts, getCategories } from "./apiCore";
import Card from "./Card";

function Shop() {
  return (
    <Layout
      title="Shop"
      description="Search the product of your choice! happy Shopping :)"
      className="container-fluid"
    >
      <div class="row">
        <div class="col-4">left side bar</div>
        <div class="col-8">right side bar</div>
      </div>
    </Layout>
  );
}

export default Shop;
